import React from 'react';
import { Route, Routes } from 'react-router-dom';

import Home from './Home';

function App() {
  const reload = () => window.location.reload();

  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="*" element={<Home />} />
    </Routes>
  );
}

export default App;
